class Solution(object):
    def lastSubstring(self, s):
        """
        :type s: str
        :rtype: str
        """
        L = len(s)
        def searchSubstring(s, idxes, step):
            from collections import defaultdict
            dicts = defaultdict(list)

            for idx in idxes:
                if idx + step < L:
                    ch = s[idx + step]
                    dicts[ch].append(idx)

            # short cuts
            for ch in sorted(dicts, key=lambda x: ord(x) * -1):
                if len(dicts[ch]) == 1:
                    return s[dicts[ch][0]:]
                # handle loop case
                elif len(dicts) == 1 and dicts[ch][1] - dicts[ch][0] == step:
                    return s[dicts[ch][0]:]
                else:
                    return searchSubstring(s, dicts[ch], step + 1)

        from collections import defaultdict
        dicts = defaultdict(list)

        for idx, ch in enumerate(s):
            dicts[ch].append(idx)

        # short cuts
        for ch in sorted(dicts, key=lambda x: ord(x) * -1):
            if len(dicts) == 1 or len(dicts[ch]) == 1:
                return s[dicts[ch][0]:]
            else:
                return searchSubstring(s, dicts[ch], 1)


